/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './personal.css';
import right from '../../images/personal/right.png';
import avatar from '../../images/personal/avatar.jpg';
import sale from '../../images/personal/sale.png';
import buy from '../../images/personal/buy.png';
import publish from '../../images/personal/publish.png';
import {Title, List} from '../../share';
import {getData, goNext} from '../../utils';
export default class Publish extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            account: '',
            password: '',
        }
    }

    goNextPage() {
        goNext(this, 'login');
    }

    render() {
        return <div>
            <Title title="个人中心" isHome={true}/>
            <div className="cm-mlr-15">
                <div className="cm-mtb-20 cm-flex cm-ai-c" onClick={() => this.goNextPage()}>
                    <img src={avatar} alt="" className="cm-img-50 cm-border-radius-half"/>
                    <div className="cm-ml-10">
                        <div className="cm-fw-bold cm-fs-18">杏子</div>
                        <div className="cm-c-999 cm-mt-10">当前卖出累计金额 <span className="cm-c-main cm-fs-18">￥12.78</span>
                        </div>
                    </div>
                </div>
                <div className="cm-line"></div>
                <List
                    leftIcon={publish}
                    leftTitle={"我发布的"}
                    rightTitle={0}
                    rightIcon={right}
                />
                <div className="cm-item cm-jc-sb">
                    <div className="cm-flex cm-ai-c">
                        <img src={sale} alt="" className="cm-img-small-icon"/>
                        <span className="cm-c-333 cm-ml-05">我卖出的</span>
                    </div>
                    <div className="cm-flex cm-ai-c"><span className="cm-c-999">0</span><img src={right} alt=""
                                                                                             className="cm-img-small-icon"/>
                    </div>
                </div>
                <div className="cm-item cm-jc-sb">
                    <div className="cm-flex cm-ai-c">
                        <img src={buy} alt="" className="cm-img-small-icon"/>
                        <span className="cm-c-333 cm-ml-05">我买到的</span>
                    </div>
                    <div className="cm-flex cm-ai-c"><span className="cm-c-999">0</span><img src={right} alt=""
                                                                                             className="cm-img-small-icon"/>
                    </div>
                </div>
                <div className="cm-item cm-jc-sb">
                    <div>
                        <img src="" alt=""/>
                        <span className="cm-c-333">修改密码</span>
                    </div>
                    <div className="cm-flex cm-ai-c"><span className="cm-c-999">0</span><img src={right} alt=""
                                                                                             className="cm-img-small-icon"/>
                    </div>
                </div>
                <div className="cm-item cm-jc-sb">
                    <div>
                        <img src="" alt=""/>
                        <span className="cm-c-333">找回密码</span>
                    </div>
                    <div className="cm-flex cm-ai-c"><span className="cm-c-999">0</span><img src={right} alt=""
                                                                                             className="cm-img-small-icon"/>
                    </div>
                </div>
                <div className="cm-tx-c cm-mt-40"><span className="cm-btn-small">安全退出</span></div>
            </div>
        </div>
    }
}
